import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Stepper from '../components/Stepper';
import { jsPDF } from 'jspdf'; 
import 'bootstrap/dist/css/bootstrap.min.css';

const FinalStep = () => {
    const { state } = useLocation(); 
    const { completedData } = state || {}; 
    const navigate = useNavigate();

    const handleGenerateReport = () => {
        
        const doc = new jsPDF();

        
        doc.text("User Report", 20, 20);
        doc.text(`Applicant's Name: ${completedData.firstName} ${completedData.lastName}`, 20, 30);
        doc.text(`Age: ${completedData.age.month}/${completedData.age.day}/${completedData.age.year}`, 20, 40);
        doc.text(`Do You Have a Disability?: ${completedData.hasDisability}`, 20, 50);
        if (completedData.hasDisability === 'Yes') {
            doc.text(`Disability Documentation: ${completedData.disabilityFile ? completedData.disabilityFile.name : 'No File Uploaded'}`, 20, 60);
        }
        doc.text(`Meal Plan Choice: ${completedData.selectedRadio}`, 20, 70);
        doc.text(`Days Requested: ${completedData.selectedDays.join(', ') || 'None'}`, 20, 80);
        doc.text(`Delivery Address: ${completedData.street}, ${completedData.city}, ${completedData.state}, ${completedData.zipCode}`, 20, 90);
        doc.text(`Delivery Instructions: ${completedData.deliveryInstructions || 'None'}`, 20, 100);
        doc.text(`Phone Number: ${completedData.phoneNumber.number1} - ${completedData.phoneNumber.number2}`, 20, 110);
        doc.text(`Email: ${completedData.email}`, 20, 120);

      
        doc.save("user_report.pdf");
    };

    const handleReturnHomepage = () => {
        navigate('/'); 
    };

    return (
        <div className="container mt-5">
            <Stepper currentStep={5} /> 

            <h2 className="mb-4">Final Step: Review Your Information</h2>

            
            <div className="mb-4">
                <h3>Applicant Details</h3>
                <p>
                    Name: {completedData.firstName} {completedData.lastName}<br />
                    Age: {`${completedData.age.month}/${completedData.age.day}/${completedData.age.year}`}<br />
                    Disability Status: {completedData.hasDisability}<br />
                    {completedData.hasDisability === 'Yes' && (
                        <span>Disability Documentation: {completedData.disabilityFile ? completedData.disabilityFile.name : 'No File Uploaded'}</span>
                    )}
                </p>
            </div>

          
            <div className="mb-4">
                <h3>Meal and Delivery Information</h3>
                <p>
                    Meal Plan Choice: {completedData.selectedRadio || 'Not Selected'}<br />
                    Days Requested: {completedData.selectedDays.length ? completedData.selectedDays.join(', ') : 'None'}<br />
                    Delivery Address: {`${completedData.street}, ${completedData.city}, ${completedData.state}, ${completedData.zipCode}` || 'Not Provided'}
                </p>
            </div>

            
            <div className="mb-4">
                <h3>Contact Information</h3>
                <p>
                    Phone Number: {`${completedData.phoneNumber.number1} - ${completedData.phoneNumber.number2}` || 'Not Provided'}<br />
                    Email: {completedData.email}
                </p>
            </div>

            
            <div className="d-flex justify-content-between">
                <button
                    className="btn btn-primary"
                    onClick={handleGenerateReport}
                >
                    Report Generator
                </button>
                <button
                    className="btn btn-secondary"
                    onClick={handleReturnHomepage}
                >
                    Return Homepage
                </button>
            </div>
        </div>
    );
};

export default FinalStep;
